INSERT INTO `Questions` VALUES (1,1,'Lonely Jeet','<p>All of Jeet\'s friends went out on Saturday night and didn\'t invite him. So Jeet sitting alone in his room decided to play a game.</p>     <p>He has <b>N</b> coin towers in his room. Each tower has a certain (non-zero) number of coins on it. In order to finish the game, Jeet wants to pick every coin from every tower.</p>      <p>jeet has an unusual method of picking these coins. In a single minute, he can perform the following task:</p>      <p> &#8226  Pick any subset of towers such that every tower in the subset has the same number of coins.<br>         &#8226  From each tower in the subset, pick any number of coins, as long as the number of coins left in the tower equals the number of coins on a tower not in the subset.</p> <p>If all towers have the same number of coins left, Jeet can pick them all in a single minute and end his game.</p>  <p>Jeet wants to finish this game as soon as possible. Can you tell him what the minimum time required is?</p>','5\r\n200\r\n8 4 5 16 24 18 2 23 15 16 11 30 28 27 25 4 28 12 20 7 16 14 18 11 12 5 16 8 9 12 24 8 30 18 28 1 20 26 8 24 20 16 13 2 29 29 5 19 24 14 28 21 18 14 14 3 21 26 30 25 10 5 4 11 13 2 26 3 4 28 16 16 18 30 7 1 8 10 17 25 26 2 15 6 4 15 27 30 30 3 21 25 24 6 17 21 18 23 27 9 7 10 12 12 13 9 3 19 21 30 20 19 15 13 15 21 22 7 2 14 27 5 26 4 5 12 2 21 25 29 20 25 7 13 22 17 27 23 1 7 13 1 14 21 27 25 27 15 10 24 6 9 13 7 18 19 2 8 16 22 26 4 9 26 15 19 18 3 15 15 12 13 5 3 13 14 14 6 5 17 27 29 26 15 4 26 27 28 3 7 12 11 12 5 1 30 30 13 7 7\r\n200\r\n27 21 19 4 4 4 17 7 11 13 12 21 30 30 30 21 20 9 27 4 30 15 4 13 8 15 28 3 16 3 17 13 9 24 4 1 12 29 22 21 10 27 2 19 1 27 17 15 25 15 24 23 24 10 16 23 30 30 21 16 28 30 27 19 25 20 6 14 9 13 3 25 13 8 4 5 15 27 4 1 3 30 16 22 20 3 27 15 29 10 23 1 18 23 28 29 27 12 26 18 30 19 22 24 2 8 23 6 29 21 9 22 8 10 17 22 3 2 14 17 10 19 7 29 17 19 17 5 29 20 29 7 9 8 5 18 25 7 13 9 26 18 19 20 2 17 15 3 18 29 7 3 17 10