 all the friends from <strong>1</strong> to <strong>k</strong> in clockwise manner. He then chose two friends, say <strong>P</strong> and <strong>Q</strong></p> <p>Dhruvik has to chose a third friend, <strong>R</strong> such that angle <strong>PRQ</strong> is <b>strictly more than 90 degrees but less than 180 degrees</b>. Dhruvik wins if he can find out how many possible friends can be assigned as <strong>R</strong>. Help Dhruvik win the game.</p>','5\r\n12 2 11\r\n98 1 98\r\n36 2 20\r\n45 13 31\r\n100 98 99','5\r\n98 1 98\r\n80 6 7\r\n30 27 2\r\n8 6 3\r\n72 30 66','5\r\n98 1 98\r\n72 30 66\r\n100 2 3\r\n17 3 10\r\n7 6 3','2\r\n0\r\n0\r\n17\r\n0','0\r\n0\r\n4\r\n2\r\n0','0\r\n0\r\n0\r\n6\r\n2',50,'<p>&#09 &#8226 1 <= T <= 5</br> &#09 &#8226 3 <= k <= 200</br> &#09 &#8226 1 <= P, Q <= k</br> &#09 &#8226 P &#8800 Q</p>','<p>The first line contains a single integer <strong>T</strong>, the number of test cases. Each test case is described by a single line containing three space-separated integers <strong>k, P, Q</strong>.</p>','<p>For each test case, output a single line containing one integer: the maximum number of possible values of <strong>R</strong>.</p>','3</br>  6 1 3</br>  6 1 4</br>  10 1 5</p>','1</br> 0</br> 3</p><br>'),(7,2,'Devang\'s New Job','<p>                 Devang got a new job as manager in an infinitely tall hotel. The ex manager was not very amused with losing his job so decided to make things difficult for Devang.               </p>             <p>                 He gave Devang a string of numbers saying that it was a list of all vacant room numbers.He left him with the instruction that all different room numbers will by in strictly increasing order.<br>                 Help Devang find the number of different ways to split the given string to get the vacant room rumbers. Print the answer modulo 1000000007             </p>             <p>                 For eg. Given string is 8967                 <li>8967</li>                 <li>8 , 967</li>                 <li>8 , 9 , 67</li>                 <li>Therefore there are three ways to split it.</li>             </p>','850\r\','870\r\','900\r\','352049569','383758052','609837977',150,'<ul>                                          <li>1 &#8804 <b>N</b> &#8804 1000</li>                                          </ul>','<ul>                 <li> The first line contains a single integer <b>N</b> denoting the number of digits in the string <b>A</b>.  </li>                 <li>  The second line contains the string with numbers from 1 to 9 inclusive.</li>                 </ul>','Output a single line containing the required answer modulo 10^9+7.','4<br>                 8967<br>','3<br>'),(8,2,'Jim vs Dwight','<p>Dwight thinks that he is the smartest guy in the entire office, but Jim doesn\'t agree.</p>\n\n<p>Jim gives Dwight an array of integers. In every move, Dwight can take the maximum from this array and divide it by 2 (integer division).</p>\n\n<p>If after dividing, the number becomes zero, Dwight has to remove it from the list.</p>\n\n<p>Before the start of the game, Jim shows Dwight the numbers in his list.</p>\n\n<p>Jim asks Dwight, <b>M</b> queries. In the <b>i-th</b> query, Dwight is given an integer Q. Dwight must tell Jim the largest number in the array which Dwight will get at the <b>Qth</b> operation, before he divides that number by 2.</p>\n\n<p>Dwight is a bit lost, and he asks you to help. Can you help him?</p>','100 10\r\n434 282 276 256 21 165 178 192 103 349 185 467 416 89 109 461 381 356 104 356 233 78 319 321 44 49 127 366 439 202 63 401 199 311 23 143 236 360 409 281 430 42 341 421 178 2 13 73 15 65 365 344 78 332 334 265 128 16 231 297 97 488 311 474 182 54 9 266 291 40 144 315 289 454 28 394 437 73 497 143 203 494 191 124 63 493 66 219 54 471 14 478 477 291 360 213 438 172 499 393\r\n1\r\n4\r\n10\r\n69\r\n100\r\n101\r\n200\r\n210\r\n211\r\n300','100 10\r\n189 429 234 80 193 488 467 139 26 226 415 350 441 461 22 317 409 256 48 291 391 243 69 276 