, 1}<br>\nIn the first query, we are asked the largest number at operation 1, which would be <b>16</b><br>\nNow the array becomes {8, 5, 4, 1}<br>\nIn the second query, we are asked the largest number at operation 2, which would be <b>8</b><br>\nNow the array becomes {4, 5, 4, 1}, and so on...<br></p>'),(9,2,'Soham Loves Chocolates','<p>                 Soham invited his <b>n</b> friends over for a party. For dinner everyone sat at his famous long table, so everyone sat on the same side of the table. Soham sat in the <b>ith</b> chair.  His dad surprised everyone and brought <b>m</b> chocolates and told Soham to distribute giving him the instruction that everyone should get atleast one.              </p>             <p>               Soham loved chocolates more than anything and tried to keep maximum chocolates to himself but he didn\'t want to be too suspiscious. He realised that his friends will be fine if the friends sitting right next to them have maximum 1 more chocolate than them otherwise they will get angry. Help Soham find the maximum chocolates he can keep for himself.             </p>             <p>                 For eg. Given n is 5,m is 8,i is 3 with 1 based Indexing.                                 <br>Answer will be 2<br>                 He can distribute it as 1 2 2 2 1.             </p>','1000000 914032367 528790','1000000 194818222 998601','100000000 106296029 98572386','30217','18389','2510',50,'<ul>                     <li>1 &#8804 <b>n</b> &#8804 1000000000</li>                     <li>1 &#8804 <b>m</b> &#8804 1000000000</li>                     <li>1 &#8804 <b>k</b> &#8804 n</li>                     </ul>','<ul>                                 <li> Input is just one line with three numbers <b>n,m,i</b>. n is the Number of friends including Soham, m is the Number of chocolates ,i is the Positon of Soham\'s seat. </li>                                  </ul>','<p>Output a single line containing the maximum chocolates Soham can have.</p>','5 8 3','2'),(10,2,'Increased Variety','<p>                Arpan had a toy shop and his shop made toys of 3 kinds. He was going to his friends party so he wanted to bring gifts. Each gift box would comprise three toys but to increase variety he would put atmost 2 of the same kind of toys in a gift box.             </p>             <p>                Given the number of toys of each kind, help Arpan find the maximum number of gift boxes he can bring.             </p>','20\r\n16830 28998 16209\r\n5993 6194 14014\r\n21179 24267 16444\r\n10016 29941 30728\r\n10525 27841 1915\r\n487 5746 29168\r\n11648 3018 29386\r\n28001 3846 13096\r\n8738 23404 4894\r\n23551 2380 19086\r\n23754 4760 21070\r\n17842 28775 16115\r\n8976 22720 29835\r\n68890 68891 68890\r\n19984 30832 18436\r\n2126 32683 7029\r\n5867 5538 16199\r\n26428 13392 25463\r\n32675 24905 17216\r\n18792 25871 20264','20\r\n7541 11453 16333\r\n24137 4932 10916\r\n26027 11334 3645\r\n11690 24320 26478\r\n1859 1242 23992\r\n12518 9022 32656\r\n19454 12220 649\r\n32412 17353 11547\r\n53352 53351 53352\r\n11752 21665 22570\r\n28846 21524 4034\r\n282 14390 3896\r\n19139 18318 9650\r\n32416 31308 32696\r\n15174 12294 5157\r\n30428 12933 24656\r\n31400 11232 15394\r\n4323 1525 24121\r\n26745 5350 15719\r\n4438 351 19455','20\r\n12747 30106 16597\r\n14522 21212 26733\r\n19978 3601 26378\r\n15258 12340 20004\r\n29952 30774 15001\r\n30401 18591 28017\r\n26606 17174 17865\r\n10770 21138 20319\r\n21320 28679 5944\r\n24542 11895 13613\r\n10379 29664 17734\r\n24077 5735 4675\r\n29591 12384 12325\r\n27708 29669 10222\r\n58892 58893 58892\r\n2801 20850 13077\r\n8219 4397 18851\r\n23602 14173 12639\r\n29626 5058 23737\r\n14372 9764 30666','20679\r\n8733\r\n20630\r\n23561\r\n12440\r\n6233\r\n14666\r\n14981\r\n12345\r\n15005\r\n16528\r\n20910\r\n20510\r\n68890\r\n23084\r\n9155\r\n9201\r\n21761\r\n24932\r\n21642','11775\r\n13328\r\n13668\r\n20829\r\n3101\r\n18065\r\n10774\r\n20437\r\n53351\r\n18662\r\n18134\r\n4178\r\n15702\r\n32140\r\n10875\