p>','3'),(13,3,'Gardening with Xoro','<p> On a planet far far away, grows only <b>4 types of plants.</b><br> Xoro thought of starting gardening. He has 2*(n-1) pots. Unfortunately the total number of plant seeds is greater than number of pots.<br> Also, number of seeds of each type of plant is greater than the number of pots! All plant seeds of the same type are identical.<br> Xoro thought that his garden would look lovely if it has <b>exactly n</b> successive plants of the same type.<br>  Help Xoro find the number of ways to fill the garden this way. </p>','15','16','17','2214592512','9462349824','40265318400',50,'3&le;n&le;30','The only line of the input contains one integer n  - the number of successive plants of the same type.','Output one integer - the number of ways to fill his garden.<br>','3<br>','24<br>'),(14,3,'Tree Queries','<p><br>Given a tree rooted at 1 having <b>n</b> nodes. Initially all vertices have value 0.<br> Process <b>m</b> queries of the form: <b>a b c</b>, such that: <br> The value <b>c</b> is added to all the descendant vertices of <b>a</b> which are at a distance of at most <b>b</b> edges from <b>a</b>. If <b>b</b> is 0, it means only consider vertex <b>a</b>. (A vertex is its own descendant) <br> After processing all queries, print the final values of all <b>n</b> nodes. <br></p>','100\r\n19 72\r\n19 53\r\n19 2\r\n2 6\r\n72 85\r\n85 23\r\n6 84\r\n19 38\r\n23 76\r\n6 49\r\n23 50\r\n19 25\r\n19 57\r\n57 65\r\n19 14\r\n25 60\r\n76 12\r\n25 99\r\n60 27\r\n72 80\r\n12 48\r\n25 52\r\n80 10\r\n49 56\r\n27 45\r\n57 3\r\n65 71\r\n71 47\r\n38 74\r\n48 58\r\n74 21\r\n57 79\r\n74 40\r\n58 30\r\n47 39\r\n50 18\r\n6 87\r\n10 92\r\n6 33\r\n48 78\r\n49 1\r\n38 36\r\n1 44\r\n10 11\r\n40 83\r\n79 17\r\n2 77\r\n50 37\r\n77 93\r\n93 61\r\n44 90\r\n83 22\r\n90 96\r\n45 63\r\n2 97\r\n90 31\r\n78 69\r\n53 41\r\n57 64\r\n83 88\r\n33 43\r\n3 16\r\n74 89\r\n6 67\r\n90 86\r\n56 29\r\n14 82\r\n63 8\r\n85 13\r\n11 28\r\n92 91\r\n67 9\r\n65 34\r\n38 46\r\n37 15\r\n46 