9 526 471 147 471 308 471 529 331 352 248 569 282 488 399 646 648 471 471 664 634 910 352 561 894 599 511 471 914 783 525 670 532 664 801 516 268 331 758 433 579 758 664 623 471 528 537 352 724 471 471 634 646 682 560 471 666 670 352','7 494 310 689 592 465 583 536 719 516 487 397 393 535 393 549 437 280 465 789 466 655 689 310 632 536 789 281 518 658 428 465 530 595 420 776 624 465 741 280 602 470 280 250 583 695 432 465 583 595 466 595 436 489 507 465 958 393 486 445 624 672 465 465 636 602 128 518 465 370 670 689 390 459 558 393 390 656 514 489 668 466 465 670 598 393 670 465 507 492 393 820 461 458 466 519 370 280 310 390',100,'<p><br>1 &#8804 n &#8804 310<sup>^</sup>5 <br> 	1 &#8804 p,q &#8804 n<br> 	1 &#8804 m &#8804 310<sup>^</sup>5<br> 	1 &#8804 a &#8804 n, 0 &#8804 b &#8804 10<sup>^</sup>9, 1 &#8804 c &#8804 10<sup>^</sup>9<br> </p>','<p><br> The first line contains single integer n (1 &#8804 n &#8804 310<sup>^</sup>5).<br> Next n1 lines contain two integers p and q (1 &#8804 p,q &#8804 n)  denoting edge between vertices p and q.<br> Next line contains single integer m (1 &#8804 m &#8804 310<sup>^</sup>5).<br> Each of next m lines contain three integers a,b,c (1 &#8804 a &#8804 n, 0 &#8804 b &#8804 10<sup>^</sup>9, 1 &#8804 c &#8804 10<sup>^</sup>9).<br></p>','<p><br> Print n integers, i<sup>th</sup> integer denoting value of i<sup>th</sup> vertex after processing all queries.<br></p>','<p><br>5 <br> 2 3 <br> 2 1 <br> 5 4 <br> 3 4 <br> 5 <br> 2 0 4 <br> 3 10 1 <br> 1 2 3 <br> 2 3 10 <br> 1 1 7 <br></p>','10 24 14 11 11<br>\n\n<p><b>Explanation</b><br>\nInitial values in nodes are 0,0,0,0,0.<br>\nAfter 1st query values of nodes are 0,4,0,0,0. After 2nd query values of nodes are 0,4,1,1,1 and so on. <br></p>'),(15,3,'Binary Password','<p>\n                Nishkal was excited to stay at Devang\'s new Hotel. After booking a room , to his surprise instead of a key he was given a binary number. When he went up to his room there was another binary number on his door and a compartment where he could put password to open the door. Nishkal went back to Devang to clarify his doubt to which Devang explained \" The password is simple, the number of ways you can swap two digits of <b>your</b> number so that the <b>bitwise OR</b> of the both the numbers will be changed from their original bitwise OR\" \n            </p>\n            <p>\n               Nishkal was too excited to enter his new room so he couldn\'t think straight. Help him find the password\n            </p>\n            <p>\n               For eg, The number given to you is 1001 and the number on the door is 1101<br>\n               The answer will be 2.<br>\n               Assuming 1 based index ,you can switch position 1 and 3 and also switch positions 3 and 4.\n                The switch is not permanent ,i.e. after switching 1 and 3, the next switch is done on the original number itself.\n                 \n            </p>','199\r\n1000110001110000011111111010000011011101001100010011010010000000111011001011101101110010010110011001100001100101001111100110101111111011011100110010111000010000110110011110010100010001011000111101100\r\n1010000110011001000000011111000001010111010001101000000110100011100000000101000010000100000001101110011111111100101010010000110000011100001000011010010111111010001100100001111000011001010110100101000','200\r\n11110010100111010110100010000001001010011001001101010000000010110111101110011010011101010000110110101101010011101110010001000110110011110100101011001101111111111011000011100110010011001110111001101010\r\n00100101110000010001101010100110000111001001011110101011110011101111101000111100110010000111100101110100101111110101000100111000000000101100110000101111011111011100000111110000011111011111000101001101','200\r\n10000010010000110011110001101000111111101010011010001011000010111001010001010001001100000000101001110000011000000100111010110000100101010101111011000110100110010011011101001011001101011010101111101110\r\n00000001001000011111100111001101010111110010001000111011100101010011100110100010011101011111101011111011001011110111000101111100110101000110110111111000110011001101011010101000111111111100001010001101','8266','7280','6883',100,'<ul>                     <li>1 &#8804 <b>N</b> &#8804 500</li>                     </ul>','<ul>                 <li> The first line contains a single integer <b>N</b> denoting the number of digits both the numbers have <b>A</b>.  </li>                 <li>  The second line contains your number of N digits</li>                 <li> The third line contains the number on the door also of N digits</li>                 </ul>','<p>Output a single line containing the password.</p>','4<br>                 1001<br>                 1101<br>','2<br>'),(16,4,'Garv and Rotations','<p><br>Garv loves to play with strings. He takes 2 equal sized(size&equals;<b>N</b>) strings S1 and S2 consisting of lower case latin letters and keeps rotating S2.<br> For example after Garv rotates a string \'wxyz\' once, the new string will be \'xyzw\'. Rotating twice, the new string will be \'yzwx\'. <br>  Garv thinks that 2 strings are friends if there exists a string S such that S is the prefix of both S1 and S2. A longer S means a stronger friendship.<br> Garv wants S1 and S2 to be best friends. Find after how many rotations of S2, the friendship between S1 and S2 is maximum.<br> If you get more than one answer, choose the one that uses minimum rotations.<br></p>','2000\r\\r\','2000\r\\r\','2000\r\\r\','848','905','310',50,'<p><br>1 &le; N &le; 10^6<br></p>','<p><br>The first line of the input contains a single integer N. <br> The second and the third line contains the strings S1 and S2 respectively.<br></p>','<p><br>Print a single integer, minmum number of rotations.<br></p>','<p><br>6<br> abccab<br> cbabcb<br></p>','<br> 2<br>'),(17,4,'Soham still loves chocolates','<p>                Soham and his friends went outside to buy chocolates. Soham wanted to buy <b>N</b> chocolates. He remembered his dads speech on sharing saying \" You have to always give out the greatest factor of the number you buy to your friends,the factor not equal to the number.\" So for eg. if he had 6 chocolates , he should give 3 away.<br>                Soham wanted to follow his dad\'s advice but again also wanted to give away minimum chocolates. He came up with a plan, if he were to buy the chocolates in batches, he could then give away the chocolates individually for each batch, hopefully minimizing the amount given away. He can\'t buy a batch of only one chocolate because then he wasn\'t sure what to do. So he only buys in batches with more than 1 chocolate at a time.             </p>             <p>                 For eg. if he wanted to buy 6 chocolates, He could first buy 3 and then buy the next 3. So he would give away 1 for the first batch and 1 for the other totalling 2.<br>                 Help Soham find the minimum he has to give away.             </p>','100\r\n5409\r\n7898\r\n23237\r\n14957\r\n17709\r\n15349\r\n5615\r\n702\r\n27406\r\n2321\r\n16544\r\n25053\r\n28762\r\n20601\r\n9924\r\n13208\r\n17136\r\n1183\r\n31961\r\n30470\r\n20446\r\n24427\r\n20980\r\n2168\r\n9602\r\n3027\r\n25349\r\n14253\r\n239\r\n3500\r\n13147\r\n3653\r\n19089\r\n23488\r\n3691\r\n23160\r\n17941\r\n24608\r\n22221\r\n21000\r\n31107\r\n21180\r\n18055\r\n24948\r\n4013\r\n8752\r\n1166\r\n31599\r\n14797\r\n24289\r\n13194\r\n31888\r\n21610\r\n23625\r\n24026\r\n30539\r\n21371\r\n31887\r\n25304\r\n31776\r\n14799\r\n23131\r\n18782\r\n12818\r\n8108\r\n17640\r\n7049\r\n21339\r\n3255\r\n16987\r\n12220\r\n25182\r\n10515\r\n3155\r\n744\r\n10973\r\n2509\r\n15041\r\n2059\r\n25452\r\n7288\r\n4346\r\n4343\r\n806\r\n30228\r\n8458\r\n13397\r\n8094\r\n2357\r\n14667\r\n21737\r\n26393\r\n1889\r\n20535\r\n11800\r\n2810\r\n29113\r\n25211\r\n2471\r\n11901','110\r\n5748\r\n11620\r\n13335\r\n27173\r\n9081\r\n30513\r\n1630\r\n23946\r\n7908\r\n18282\r\n1162\r\n29633\r\n4677\r\n4715\r\n24149\r\n14129\r\n20928\r\n16862\r\