>First line contains an integer N, number of houses in Wumpyland. <br> Each of next N-1 lines contain 2 space separated integers implying that there is an road between these two houses.<br> Next line contains Q, number of queries.<br> First line of each query contains an integer H.<br> Second line contains H space separated house indexes.<br></p>','<p>For each query, print \"Yes\" in a new line if Popo can visit the given houses. Otherwise, print \"No\".<br></p>','<p> <br>10<br>\n3 1<br>5 7<br>4 6<br>10 4<br>8 9<br>2 1<br>3 4<br>8 5<br>5 3<br>2<br>3<br>8 10 3<br>3<br>6 2 5<br></p> ','Yes<br>\nNo<br></p>\n<p><b>Explanation</b><br>\nQuery 1: The possible walk is 8->5->3->4->10.<br>\nQuery 2: There does not a walk joining the 3 houses. <br></p>'),(23,5,'Peer Pressure','<p>     There are <b>n</b> people standing in a circle having a debate with opinions being labeled \'B\' or \'W\'<br>     Initially each person has an opinion \'B\' or \'W\' but then <b>p</b> rounds of discussion occur.<br>     In each discussion, person <b>i</b> is influenced it\'s left and right neighbour i.e person <b>(i-1)</b> and <b>(i+1)</b> for i from 2 to n-1. 1st person is influenced by n<sup>th</sup> and 2<sup>nd</sup> person, and N<sup>th</sup> person is influenced by (n-1)<sup>th</sup> and 1<sup>st</sup> person<br>     Now for each person i in a discussion, it\'s 2 neighbours and itself are considered. The opinion of ith person changes to the majority of the opinions of it\'s neighbours and itself<br>     For eg, consider \'B\', \'B\', \'W\' to be the opinions of 3 people.<br>     For person 1, the opinion will remain the same, since there are 2 \'B\' opinions and 1 \'W\'. Same goes for person 2, and person 3 will change his opinion to \'B\'<br>     Therefore \'B\', \'B\', \'B\' are the opinions after 1 discussion.(The string is changed after the discussion) </p>','75 274505565\r\nWBWBWBWBBWBWBWBWBWBWBWBBBBWBBBBBWWBWWBWBWBWBWBWBBBBBWWWWWBBBWWWWWBWWWWWBBWB','53 426546319\r\nBBWBBBBBBWBWBBBWBBB